import Footer from './Footer';
import { API_HOST } from './constants';

function QueryArea() {

    const [data, setData] = useState([]);

    useEffect(() => {
        fetch(API_HOST + "/allmusic")
        .then((res) => res.json())
        .then((data) => {
            setData(data);
        })
        .catch((err) => {
            console.log(err);
        });
    }, []);

    return (

        <div>
            <div>
                Queries will be taken Soon!!!
            </div>
            <Footer />
        </div>

        );

}

export default QueryArea;
